from typing import List
import math
from collections import defaultdict, Counter
from bisect import bisect_left
from itertools import accumulate


class Solution1:
    def countSubarrays(self, nums: List[int], k: int) -> int:
        """This is O(N^2). No wonder it TLE.
        """
        psmall = [0]
        for n in nums:
            if n < k:
                psmall.append(psmall[-1] + 1)
            else:
                psmall.append(psmall[-1])
        idx = nums.index(k)
        N = len(nums)
        res = 1
        for l in range(2, N + 1):
            tgt = (l - 1) // 2
            left, right = max(idx - (l - 1), 0), min(idx + (l - 1), N - 1)
            if psmall[right + 1] - psmall[left] < tgt:
                continue
            for i in range(left, right - l + 2):
                res += int(psmall[i + l] - psmall[i] == tgt)
        return res


class Solution2:
    def countSubarrays(self, nums: List[int], k: int) -> int:
        """This one is hard, even after I have read the hint.

        The basic idea is to mark each number larger than k with 1, smaller than
        k with -1, and equal to k with 0. Then we produce a prefix sum of the
        marked array.

        For k to be the median, a subarray sum must be either 0 or 1.

        So we handle this in three steps. And to simplify the implementation, we
        produce an indices map where the prefix sum is the key, and an array of
        indices is the value, NOT including the index of k.

        Step 1: Find the total number of subarray starting from the beginning
        with sum 0 or 1. NOTE that we have to also include the case where the
        prefix sum at the index of k is 0 or 1.

        Step 2: Find the total number of subarray that goes across k, including
        the situation where the subarray starts with k.

        Step 3: Find the total number of subarrays that end in k.

        O(NlogN), 1694 ms, faster than 15.29%
        """
        indices = defaultdict(list)
        idx = nums.index(k)
        presum = list(accumulate(1 if n > k else (-1 if n < k else 0) for n in nums))
        for i, p in enumerate(presum):
            if i != idx:
                indices[p].append(i)
        N = len(nums)
        # handle subarray starting from the beginning
        res = len(indices.get(0, [])) - bisect_left(indices.get(0, []), idx) + int(presum[idx] == 0)
        res += len(indices.get(1, [])) - bisect_left(indices.get(1, []), idx) + int(presum[idx] == 1)
        # handle other subarrays
        for k_, v in indices.items():
            # odd length subarray
            i = bisect_left(v, idx)
            res += i * (len(v) - i)
            # even length subarray
            j = bisect_left(indices.get(k_ + 1, []), idx)
            res += i * (len(indices.get(k_ + 1, [])) - j)
        # handle subarray ending in k
        res += bisect_left(indices[presum[idx]], idx)
        res += bisect_left(indices[presum[idx] - 1], idx)
        return res


class Solution3:
    def countSubarrays(self, nums: List[int], k: int) -> int:
        """Same idea as Solution2, but we don't have to use binary search to
        find the count. We can use counter directly.

        I don't know why I hadn't thought about using Counter directly. This is
        not the first time that I have used binary search for a problem that can
        be easily solved using Counter.

        O(N), 504 ms, faster than 97.72%
        """
        idx = nums.index(k)
        # note that presum as a zero a the beginning
        presum = list(accumulate((1 if n > k else (-1 if n < k else 0) for n in nums), initial=0))
        # counter of presum to the left of k, and counter of presum to the right
        # of k (including k)
        lc, rc = Counter(presum[:idx + 1]), Counter(presum[idx + 1:])
        res = 0
        for k_, v in lc.items():
            res += v * rc[k_]  # odd length subarray
            res += v * rc[k_ + 1]  # even length subarray
        return res


